  KEY `index_quests_on_achievement` (`achievement`),
  CONSTRAINT `quests_ibfk_1` FOREIGN KEY (`parent_id`) REFERENCES `quests` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10407 DEFAULT CHARSET=utf8;
